import React, { useState, useEffect } from "react";
import axios from "axios";
import RoacketsItems from "./RoacketsItems";
const Rockets = () => {
  const [data, setData] = useState([]);
  const [image,setImage]= useState()
  const fetchData = () => {
    axios
      .get("https://api.spacexdata.com/v4/rockets")
      .then((response) => {
        console.log(response.data);
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };
  useEffect(() => {
    fetchData();
  }, []);
  const changeState = () => {

  }
  return (
    <div className="container my-5">
      <div className="row">
        {data.map((res) => {
          return (
            // <div key={res.id}>
            <>
              <div className="col-sm-6">
                <RoacketsItems
                  name={res.name}
                  description={res.description}
                  active={res.active}
                  boosters={res.boosters}
                  company={res.company}
                  cost={res.cost_per_launch}
                  country={res.country}
                  diameter={res.diameter.meters}
                  engines={res.engines.engine_loss_max}
                  number={res.engines.number}
                  type={res.engines.type}
                  first_flight={res.first_flight}
                  version={res.engines.version}
                  mass={res.mass.kg}
                  first_stage={res.first_stage.burn_time_sec}
                  fstageEngines={res.first_stage.engines}
                  fuel_amount_tons={res.first_stage.fuel_amount_tons}
                  secondStageBurnTime={res.second_stage.burn_time_sec}
                  SecondStageengines={res.second_stage.engines}
                  secondStageFuelAmout={res.second_stage.fuel_amount_tons}
                  secondReuse={res.second_stage.reusable}
                  wikipedia={res.wikipedia}
                />
              </div>
              <div className="col-sm-6 my-5">
                {/* <img
                  src={res.flickr_images}
                  className="card-img-top img-fluid"
                  alt="..."
                  style={{ height: "400px" }}

                /> */}

{/* <!-- Carousel wrapper --> */}
<div id="carouselExampleIndicators" className="carousel slide carousel-fade" data-mdb-ride="carousel">
  {/* <!-- Slides --> */}
  <div className="carousel-inner mb-5">
    <div className="carousel-item active">
      <img src={res.flickr_images} className="d-block w-100" alt="..." />
    </div>
    <div className="carousel-item">
      <img src={res.flickr_images[0]} className="d-block w-100"
        alt="..." />
    </div>
    <div className="carousel-item">
      <img src="https://mdbcdn.b-cdn.net/img/Photos/Slides/img%20(31).webp" className="d-block w-100" alt="..." />
    </div>
  </div>
  {/* <!-- Slides --> */}

  {/* <!-- Controls --> */}
  <button className="carousel-control-prev" type="button" data-mdb-target="#carouselExampleIndicators"
    data-mdb-slide="prev">
    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
    <span className="visually-hidden">Previous</span>
  </button>
  <button className="carousel-control-next" type="button" data-mdb-target="#carouselExampleIndicators"
    data-mdb-slide="next" onClick={changeState}>
    <span className="carousel-control-next-icon" aria-hidden="true"></span>
    <span className="visually-hidden">Next</span>
  </button>
  {/* <!-- Controls --> */}

  {/* <!-- Thumbnails --> */}
  <div className="carousel-indicators" style={{marginBottom: "20px"}}>
    {/* <button type="button" data-mdb-target="#carouselExampleIndicators" data-mdb-slide-to="0" className="active"
      aria-current="true" aria-label="Slide 1" style={{width: "100px"}}>
      <img className="d-block w-100 img-fluid"
        src="https://mdbcdn.b-cdn.net/img/Photos/Others/Carousel-thumbs/img%20(88).webp"  />
    </button> */}
    <button type="button" data-mdb-target="#carouselExampleIndicators" data-mdb-slide-to="1"
      aria-label="Slide 2" style={{width: "100px"}}>
      <img className="d-block w-100 img-fluid"
        src={res.flickr_images[1]} />
    </button>
    <button type="button" data-mdb-target="#carouselExampleIndicators" data-mdb-slide-to="2"
      aria-label="Slide 3" style={{width: "100px"}}>
      <img className="d-block w-100 img-fluid"
        src={res.flickr_images[0]} />
    </button>
  </div>
  {/* <!-- Thumbnails --> */}
</div>
{/* <!-- Carousel wrapper --> */}


              </div>
            </>
          );
        })}
      </div>
    </div>
  );
};

export default Rockets;
